import Axios from 'axios'

export const getPost = (id) => {
    console.log(id)

    var PostX = {
        Title: 'holanda',
        Body: 'dadad'
    }

    const getX = async (id) => {

        var PostY = {
            Title: 'truco',
            Body: 'fwfffw'
        }

        Axios.get(`https://jsonplaceholder.typicode.com/posts/${id}`)
        .then((res) => {
            PostY.Title = res.data.title;
            PostY.Body = res.data.body;

            console.log(PostY.Title + " 3");
            console.log(res.data);



        })
        .catch(err => {
            PostX.Title = "No existe el post";
            console.log(err + "Error peticion")
        })

        return PostY

    }

    PostX = getX(id)


    return PostX

}
